%% Dvoretzky 离散控制系统仿真：阶跃响应分析
% 系统: Δ_{k+1} = (1-α_k)Δ_k + α_k·η_k
% 其中: Δ_k = ω_k - ω*, η_k = x_k - ω*
% 等价于: ω_{k+1} = (1-α_k)ω_k + α_k·x_k

clear all; close all; clc;


%% 参数设置
N = 1000;           % 仿真步数
omega_star = 0;     % 目标值（可以调整）
omega0 = 5;         % 初始估计值

% 定义阶跃输入（多台阶）
step_times = [0, 200, 400, 600, 800, N];  % 台阶切换时间点
step_values = [0, 1, -0.5, 2, -1, 0];      % 每个台阶的值

% 生成阶跃输入序列 x_k
x = zeros(1, N);
for i = 1:length(step_times)-1
    start_idx = step_times(i)+1;
    end_idx = step_times(i+1);
    x(start_idx:end_idx) = step_values(i);
end

% 初始化变量
omega = zeros(1, N);
omega(1) = omega0;
Delta = zeros(1, N);
Delta(1) = omega(1) - omega_star;
eta = zeros(1, N);
%%%%%%%%%%
% 增益序列 α_k = 1/k (从k=2开始，避免除以0) α收敛太快，导致系统收敛太慢（极点近单位圆）
% alpha = zeros(1, N);
% alpha(1) = 1;  % α_1 = 1
% for k = 2:N
%     alpha(k) = 1/k;
% end
%%%%%%%%%%
alpha = zeros(1, N);
alpha(1) = 1;  % α_1 = 1  系数过大可能会把系统干不稳定
for k = 2:N
    alpha(k) = 10/k;  % 这里的系数还好，可以稍微大一点，这又是个有趣的时变系统收敛性问题。
end
%%%%%%%%%%%
%%固定alpha
% alpha = 0.9*ones(1, N);
%%%%%%%%%%%

%% 系统仿真
for k = 1:N-1
    % 计算 η_k = x_k - ω*
    eta(k) = x(k) - omega_star;
    
    % 更新 Δ_{k+1} = (1-α_k)Δ_k + α_k·η_k
    Delta(k+1) = (1 - alpha(k)) * Delta(k) + alpha(k) * eta(k);
    
    % 计算 ω_{k+1} = Δ_{k+1} + ω*
    omega(k+1) = Delta(k+1) + omega_star;
end

% 计算最后一个η值
eta(N) = x(N) - omega_star;

%% 绘制结果
figure('Position', [100, 100, 1200, 800]); %[output:9b76e6f4]

% 子图1：输入x_k和输出ω_k随时间变化
subplot(3, 2, [1, 2]); %[output:9b76e6f4]
hold on; %[output:9b76e6f4]
plot(1:N, x, 'b-', 'LineWidth', 2, 'DisplayName', '输入 x_k'); %[output:9b76e6f4]
plot(1:N, omega, 'r-', 'LineWidth', 2, 'DisplayName', '输出 ω_k'); %[output:9b76e6f4]
plot([1, N], [omega_star, omega_star], 'k--', 'LineWidth', 1.5, 'DisplayName', '目标值 ω^*'); %[output:9b76e6f4]
xlabel('时间步 k'); %[output:9b76e6f4]
ylabel('幅值'); %[output:9b76e6f4]
title('Dvoretzky系统阶跃响应: 输入x_k vs 输出ω_k'); %[output:9b76e6f4]
legend('Location', 'best'); %[output:9b76e6f4]
grid on; %[output:9b76e6f4]
hold off; %[output:9b76e6f4]

% 子图2：增益序列α_k
subplot(3, 2, 3); %[output:9b76e6f4]
semilogy(1:N, alpha, 'g-', 'LineWidth', 2); %[output:9b76e6f4]
xlabel('时间步 k'); %[output:9b76e6f4]
ylabel('α_k (对数尺度)'); %[output:9b76e6f4]
title('时变增益序列: α_k = 1/k'); %[output:9b76e6f4]
grid on; %[output:9b76e6f4]

% 子图3：估计误差Δ_k
subplot(3, 2, 4); %[output:9b76e6f4]
plot(1:N, Delta, 'm-', 'LineWidth', 2); %[output:9b76e6f4]
hold on; %[output:9b76e6f4]
plot([1, N], [0, 0], 'k--', 'LineWidth', 1.5); %[output:9b76e6f4]
xlabel('时间步 k'); %[output:9b76e6f4]
ylabel('估计误差 Δ_k'); %[output:9b76e6f4]
title('估计误差动态: Δ_k = ω_k - ω^*'); %[output:9b76e6f4]
grid on; %[output:9b76e6f4]
hold off; %[output:9b76e6f4]

% 子图4：η_k序列
subplot(3, 2, 5); %[output:9b76e6f4]
plot(1:N, eta, 'c-', 'LineWidth', 2); %[output:9b76e6f4]
hold on; %[output:9b76e6f4]
plot([1, N], [0, 0], 'k--', 'LineWidth', 1.5); %[output:9b76e6f4]
xlabel('时间步 k'); %[output:9b76e6f4]
ylabel('η_k'); %[output:9b76e6f4]
title('观测偏差: η_k = x_k - ω^*'); %[output:9b76e6f4]
grid on; %[output:9b76e6f4]
hold off; %[output:9b76e6f4]

% 子图5：系统动态的相平面分析 (Δ_k vs Δ_{k+1})
subplot(3, 2, 6); %[output:9b76e6f4]
plot(Delta(1:N-1), Delta(2:N), 'b.', 'MarkerSize', 8); %[output:9b76e6f4]
hold on; %[output:9b76e6f4]
plot([min(Delta), max(Delta)], [min(Delta), max(Delta)], 'k--', 'LineWidth', 1.5); %[output:9b76e6f4]
xlabel('Δ_k'); %[output:9b76e6f4]
ylabel('Δ_{k+1}'); %[output:9b76e6f4]
title('系统相平面: Δ_{k+1} vs Δ_k'); %[output:9b76e6f4]
axis equal; %[output:9b76e6f4]
grid on; %[output:9b76e6f4]
hold off; %[output:9b76e6f4]

%% 分析稳态性能
% 提取每个台阶稳定后的数据
steady_state_values = zeros(length(step_times)-1, 3);
steady_state_errors = zeros(length(step_times)-1, 1);

for i = 1:length(step_times)-1
    start_idx = step_times(i)+1;
    end_idx = step_times(i+1);
    
    % 取后1/3作为稳态区间
    steady_start = floor(start_idx + (end_idx - start_idx) * 2/3);
    steady_range = steady_start:end_idx;
    
    if ~isempty(steady_range)
        steady_state_values(i, 1) = mean(x(steady_range));      % 输入平均值
        steady_state_values(i, 2) = mean(omega(steady_range));  % 输出平均值
        steady_state_values(i, 3) = mean(Delta(steady_range));  % 误差平均值
        steady_state_errors(i) = abs(steady_state_values(i, 3)); % 绝对误差
    end
end

%% 显示稳态分析结果
fprintf('========== Dvoretzky系统阶跃响应分析 ==========\n'); %[output:10a97195]
fprintf('仿真参数: N=%d, ω*=%d, ω0=%d\n\n', N, omega_star, omega0); %[output:07b17ab1]
fprintf('阶跃输入配置:\n'); %[output:1d4d8306]
for i = 1:length(step_times)-1 %[output:group:2689fe46]
    fprintf('  台阶%d: 时间[%d, %d], 幅值=%.2f\n', ... %[output:4cbbfee2]
        i, step_times(i), step_times(i+1), step_values(i)); %[output:4cbbfee2]
end %[output:group:2689fe46]
fprintf('\n');

fprintf('稳态性能分析:\n'); %[output:6e8cee4e]
fprintf('台阶 | 输入均值 | 输出均值 | 误差均值 | 绝对误差\n'); %[output:95f80d39]
fprintf('-----|----------|----------|----------|----------\n'); %[output:6cd2fee3]
for i = 1:length(step_times)-1 %[output:group:356103a1]
    fprintf('%4d | %8.4f | %8.4f | %8.4f | %8.4f\n', ... %[output:796df50a]
        i, steady_state_values(i, 1), steady_state_values(i, 2), ... %[output:796df50a]
        steady_state_values(i, 3), steady_state_errors(i)); %[output:796df50a]
end %[output:group:356103a1]
fprintf('\n');

% 计算总体性能指标
final_error = abs(Delta(N));
fprintf('总体性能指标:\n'); %[output:4a06f584]
fprintf('最终估计误差: %.6f\n', final_error); %[output:146de86e]
fprintf('误差最大值: %.6f\n', max(abs(Delta))); %[output:7beb7ebe]
fprintf('误差均方根(RMS): %.6f\n', rms(Delta)); %[output:069f6ebb]
fprintf('\n');

%% 添加频域分析
figure('Position', [100, 100, 1000, 400]); %[output:7462ec35]

% 计算频率响应
Fs = 1;  % 采样频率为1 Hz (每个时间步一个样本)

% 输入和输出的频谱
N_fft = 2^nextpow2(N);
X_f = fft(x, N_fft);
Omega_f = fft(omega, N_fft);
frequencies = (0:N_fft-1)*(Fs/N_fft);

% 幅度谱
subplot(1, 2, 1); %[output:7462ec35]
semilogx(frequencies(2:N_fft/2), 20*log10(abs(X_f(2:N_fft/2))), 'b-', 'LineWidth', 1.5); %[output:7462ec35]
hold on; %[output:7462ec35]
semilogx(frequencies(2:N_fft/2), 20*log10(abs(Omega_f(2:N_fft/2))), 'r-', 'LineWidth', 1.5); %[output:7462ec35]
xlabel('频率 (Hz)'); %[output:7462ec35]
ylabel('幅度 (dB)'); %[output:7462ec35]
title('输入/输出幅度谱'); %[output:7462ec35]
legend('输入 x_k', '输出 ω_k'); %[output:7462ec35]
grid on; %[output:7462ec35]
hold off; %[output:7462ec35]

% 估计系统的频率响应
H_est = Omega_f ./ X_f;
H_est(1) = 1;  % 避免直流分量除零

subplot(1, 2, 2); %[output:7462ec35]
semilogx(frequencies(2:N_fft/2), 20*log10(abs(H_est(2:N_fft/2))), 'g-', 'LineWidth', 2); %[output:7462ec35]
xlabel('频率 (Hz)'); %[output:7462ec35]
ylabel('幅度 (dB)'); %[output:7462ec35]
title('估计系统频率响应 |H(f)|'); %[output:7462ec35]
grid on; %[output:7462ec35]

%% 对比不同增益策略的效果
figure('Position', [100, 100, 1200, 400]); %[output:28ab52c8]

% 定义不同的增益策略
alpha_strategies = cell(3, 1);
alpha_strategies{1} = 1./(1:N);              % α_k = 1/k
alpha_strategies{2} = 10./(10 + (1:N));      % α_k = 10/(10+k)
alpha_strategies{3} = 0.1./(0.1 + (1:N).^0.5); % α_k = 0.1/(0.1+√k)

strategy_names = {'α_k = 1/k', 'α_k = 10/(10+k)', 'α_k = 0.1/(0.1+√k)'};
colors = {'r', 'g', 'b'};

% 仿真不同增益策略
omega_results = zeros(3, N);
for s = 1:3
    omega_s = zeros(1, N);
    omega_s(1) = omega0;
    
    for k = 1:N-1
        omega_s(k+1) = (1 - alpha_strategies{s}(k)) * omega_s(k) + ...
                       alpha_strategies{s}(k) * x(k);
    end
    
    omega_results(s, :) = omega_s;
end

% 绘制对比结果
subplot(1, 2, 1); %[output:28ab52c8]
hold on; %[output:28ab52c8]
plot(1:N, x, 'k-', 'LineWidth', 3, 'DisplayName', '输入 x_k'); %[output:28ab52c8]
for s = 1:3
    plot(1:N, omega_results(s, :), colors{s}, 'LineWidth', 2, ... %[output:28ab52c8]
         'DisplayName', strategy_names{s}); %[output:28ab52c8]
end
plot([1, N], [omega_star, omega_star], 'k--', 'LineWidth', 1.5, 'DisplayName', 'ω^*'); %[output:28ab52c8]
xlabel('时间步 k'); %[output:28ab52c8]
ylabel('幅值'); %[output:28ab52c8]
title('不同增益策略的阶跃响应对比'); %[output:28ab52c8]
legend('Location', 'best'); %[output:28ab52c8]
grid on; %[output:28ab52c8]
hold off; %[output:28ab52c8]

% 绘制增益序列对比
subplot(1, 2, 2); %[output:28ab52c8]
hold on; %[output:28ab52c8]
for s = 1:3
    plot(1:N, alpha_strategies{s}, colors{s}, 'LineWidth', 2, ... %[output:28ab52c8]
         'DisplayName', strategy_names{s}); %[output:28ab52c8]
end
xlabel('时间步 k'); %[output:28ab52c8]
ylabel('α_k'); %[output:28ab52c8]
title('不同增益序列对比'); %[output:28ab52c8]
set(gca, 'YScale', 'log'); %[output:28ab52c8]
legend('Location', 'best'); %[output:28ab52c8]
grid on; %[output:28ab52c8]
hold off; %[output:28ab52c8]

